;; **
;;; ## Assertion
;; **

;; **
;;; * Connect to a database
;; **

;; @@
(ns datomic-doc.tutorial
  (:require	[clojure.core.async :refer (<!!)]
            [datomic.client :as client]))

(def conn
  (<!! (client/connect
         {:db-name "hello"
          :account-id client/PRO_ACCOUNT
          :secret "mysecret"
          :region "none"
          :endpoint "localhost:8998"
          :service "peer-server"
          :access-key "myaccesskey"})))
