;; **
;;; * Add colors to the inventory database
;; **

;; @@
(<!! (client/transact conn
                      {:tx-data [{:db/ident :red}
                                 {:db/ident :green}
                                 {:db/ident :blue}
                                 {:db/ident :yellow}]}))
