;; **
;;; * Pull: *pull the color, type, and size for SKU-42*
;; **

;; @@
(<!! (client/pull
      db
      {:eid [:inv/sku "SKU-42"]
       :selector [{:inv/color [:db/ident]}
                  {:inv/size [:db/ident]}
                  {:inv/type [:db/ident]}]}))
