;; **
;;; #### history Query 
;; **

;; **
;;; * Show the complete history of :inv/count data for items that have a SKU
;; **

;; @@
(require '[clojure.pprint :as pp])
(def db-hist (client/history db))
(->> (<!! (client/q
            conn
            {:query '[:find ?tx ?sku ?val ?op
                      :where
                      [?inv :inv/count ?val ?tx ?op]
                      [?inv :inv/sku ?sku]]
             :args [db-hist]}))
     (sort-by first)
     (pp/pprint))
